import React, { Component } from 'react'
import './Footer.scss'

export default class Footer extends Component {

  constructor(props) {
    super(props);
    this.state = {
      company: [
        'About us',
        'Story',
        'Benefits',
        'FAQs',
      ],
      client: [
        'Client service',
        'Purchase',
        'Assistance',
        'Devilvery',
        'Payment',
        'Claims'
      ],
      legal: [
        'Legal',
        'Terms & Conditions',
        'Privacy Policy'
      ]

    }
  }

  render() {

    let { company, client, legal } = this.state

    return (
      <div className='Container__footer-wrapper'>
        <div className="Container__footer-info">
          <div className='item'>
            <ul className='menu'>
              {company.map(item => {
                return (
                  <li className='anchor'><a href="#">{item}</a></li>
                )
              })}
            </ul>
          </div>
          <div className='item'>
            <ul className='menu'>
              {client.map(item => {
                return (
                  <li className='anchor'><a href="#">{item}</a></li>
                )
              })}
            </ul>
          </div>
          <div className='item'>
            <ul className='menu'>
              {legal.map(item => {
                return (
                  <li className='anchor'><a href="#">{item}</a></li>
                )
              })}
            </ul>
          </div>
        </div>
      </div>
    )
  }
}
